geregisseerd door Chris Berkeley, Lauren Montgomery en Jay Oliva
met de stemmen van Nathan Fillion, Kelly Hu en Elisabeth Moss

Het verhaal van het ontstaan van \'Green Lantern Corps\', met de eerste ringdragers. Green Lantern Corps is een groepering van ringdragers die over het hele universum regeren. Deze groene ringen geven hen de kracht om alles wat zij kunnen bedenken te verwezenlijken. Zij krijgen tevens ieder de taak om een sector van het universum te beschermen tegen het kwaad. Hal Jordan is de Green Lantern die sector aarde onder zijn hoede heeft.

